import React from "react";
import PropTypes from "prop-types";
import Card from "../Card";
import cards from "../../cards.json"

const Board = props => <div className="board">{props.children}
        <Card 
            key={cards.id}
            id={cards.id}
            type={cards.type}
        />
    </div>
export default Board;
